import React from "react";
import Card from "@mui/material/Card"
import CardMedia from "@mui/material";
import CardContent from "@mui/material";
import Typography from "@mui/material";

export default function CardMenu() {
    return(
        <Card>
            <CardMedia
                component="img"
                wide
                height={100}
                image="https://images.unsplash.com/photo-1682687982470-8f1b0e79151a?ixlib=rb-4.0.3&ixid=M3wxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2670&q=80"
                title="Paella dish" />
            <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                    CardMedia Example
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                    The CardMedia component sets a background image to cover available space.
                </Typography>
            </CardContent>
        </Card>
    )
}
